import "../css/Game.css";
import TetrisHeader from "./TetrisHeader";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSquareCaretLeft, faSquareCaretRight, faSquareCaretUp, faSquareCaretDown } from "@fortawesome/free-regular-svg-icons";




const Game = () => {
    return(
        <div className="Game">
            <TetrisHeader />
            <div className="Tetris-home">
                <div className="help">
                    <h1>HELP</h1>

                    <div className="left">
                        <FontAwesomeIcon icon={faSquareCaretLeft} />
                    </div>

                    <div className="right">
                    <FontAwesomeIcon icon={faSquareCaretRight} />
                    </div>
                </div>
                <div>SINGLE</div>
            </div>
        </div>
    )
}
export default Game;
